  /* qqqexint -- Returns an integer extracted from a string */                                                                                                                                                                                                      
  static int qqqexint(char * qqscan_str)                                                                                                                                                                                                                            
  {                                                                                                                                                                                                                                                                 
    int qqvalue;                                                                                                                                                                                                                                                    
    int qqisign;                                                                                                                                                                                                                                                    
    char * qqcptr;                                                                                                                                                                                                                                                  
    qqvalue = 0;                                                                                                                                                                                                                                                    
    qqisign = 1;                                                                                                                                                                                                                                                    
    qqcptr  = qqscan_str;                                                                                                                                                                                                                                           
    /* Skip spaces */                                                                                                                                                                                                                                               
    while (qqcptr[0] == ' ')                                                                                                                                                                                                                                        
    {                                                                                                                                                                                                                                                               
      qqcptr++;                                                                                                                                                                                                                                                     
    }                                                                                                                                                                                                                                                               
    /* Check for a leading --- */                                                                                                                                                                                                                                   
    if (qqcptr[0] == '-')                                                                                                                                                                                                                                           
    {                                                                                                                                                                                                                                                               
      qqisign = -1;                                                                                                                                                                                                                                                 
      qqcptr++;                                                                                                                                                                                                                                                     
    }                                                                                                                                                                                                                                                               
    /* Extract digits */                                                                                                                                                                                                                                            
    while ((qqcptr[0] >= '0') && (qqcptr[0] <= '9'))                                                                                                                                                                                                                
    {                                                                                                                                                                                                                                                               
      qqvalue = 10 * qqvalue;                                                                                                                                                                                                                                       
      qqvalue = qqvalue + (qqcptr[0] - '0');                                                                                                                                                                                                                        
      qqcptr++;                                                                                                                                                                                                                                                     
    }                                                                                                                                                                                                                                                               
    qqvalue = qqisign * qqvalue;                                                                                                                                                                                                                                    
    return qqvalue;                                                                                                                                                                                                                                                 
  } /* End of qqqexint */                                                                                                                                                                                                                                           
  /*  qqqpstr -- Extracts n probes from a string */                                                                                                                                                                                                                 
  static int qqqpstr(int n, char * str)                                                                                                                                                                                                                             
  {                                                                                                                                                                                                                                                                 
    int i,from;                                                                                                                                                                                                                                                     
    if (n!=0)                                                                                                                                                                                                                                                       
    {                                                                                                                                                                                                                                                               
      for (i=0;i<n;i++)                                                                                                                                                                                                                                             
      {                                                                                                                                                                                                                                                             
        from = qqqexint(str); /* Extract the probe from the string */                                                                                                                                                                                               
        ldra_data=qmsk(from);                                                                                                                                                                                                                                       
        str+=8;  /* Each probe is 8 characters */                                                                                                                                                                                                                   
      }                                                                                                                                                                                                                                                             
    }                                                                                                                                                                                                                                                               
    return 0;                                                                                                                                                                                                                                                       
  } /* end of qqqpstr */                                                                                                                                                                                                                                            
