#if defined(QQQdo178b)                                                                                                                                                                                                                                              
        if (qqqmcdcsuppress == 0)                                                                                                                                                                                                                                   
        {                                                                                                                                                                                                                                                           
          mmWaveCfar_3zzzfun(qqqi) ;                                                                                                                                                                                                                                
      }                                                                                                                                                                                                                                                             
#else                                                                                                                                                                                                                                                               
        mmWaveCfar_3zzzfun(qqqi) ;                                                                                                                                                                                                                                  
#endif  /* defined(QQQdo178b) */                                                                                                                                                                                                                                    
#else                                                                                                                                                                                                                                                               
        /* uncompressed */                                                                                                                                                                                                                                          
#ifdef QQBUFFEREDQQ                                                                                                                                                                                                                                                 
        /* uncompressed buffered */                                                                                                                                                                                                                                 
        /*      qqprint(&qqqi); */                                                                                                                                                                                                                                  
