  qqqlast = 0;                                                                                                                                                                                                                                                      
#endif  /* defined(QQQSINGLEFILE) || defined(QQQseparate) */                                                                                                                                                                                                        
    /* If not using atexit to register the bitmap upload function must call upload function here */                                                                                                                                                                 
#ifdef QQQUPLOADATEND                                                                                                                                                                                                                                               
